import React from "react";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
);

const Chart = ({ array, labels, label }) => {
  var dataSet = {
    labels: labels,
    datasets: [
      {
        label: `${label}`,
        data: array,
        tension: 0.5,
        fill: true,
        borderColor:
          "rgb (" +
          (Math.floor(Math.random() * (255 - 1 + 1)) + 1).toString() +
          "," +
          (Math.floor(Math.random() * (255 - 1 + 1)) + 1).toString() +
          ",)",
      },
    ],
  };
  return <Line data={dataSet} />;
};

export default Chart;
